        width: "100%",
        position: "relative",
        bottom: 0,
        display: "flex",
        justifyContent: "center",}}
>
                <Container>
                    <Row>
                    <Col className="text-center py-3">Copyright &copy; IMS INSTITUTE</Col>
        
                    </Row>

                </Container>


       </footer>
    );
};

export default Footer;
